.tableTradeHis{
    height: 400px;
}

#tradeHisPage{
    padding: 25px 4rem;
}

.table-bordered td {
    border-color: #797979;
}

.table-bordered thead th {
    color: rgba(255, 255, 255, 0.5);
    font-weight: 400;
    border-bottom-width: 1px;
    border-color: #797979;
    text-align: center;
}

.dateRange > span {
    flex: 0 0 40px;
    text-align: center;
    line-height: 40px;
    color: #fff;
}

.dateRange .customeTradeHistory:first-child {
    padding-right: 20px;
}

.dateRange .customeTradeHistory:last-child {
    padding-right: 20px;
}

.dateRange {
    display: flex;
    max-width: 300px;
}


.bostats {
    min-height: 292px;
    border-radius: 22px;
    border: 1px solid #41416F;
    background-color: #28384a;
}

.wrap-chart .chart-instance {
    border-bottom-left-radius: 5px;
    border-bottom-right-radius: 5px;
    padding-bottom: 5px;
}

.tradeHistory .userStat.revenue {
    background-color: #31BAA0;
}

.tradeHistory .userStat.profits {
    background-color: #94886d;
}

.tradeHistory .userStat {
    border-radius: 14px;
    padding-left: 30px;
    padding-right: 30px;
}

.tradeHistory .userStat .wrap {
    flex: 1;
    display: flex;
    max-width: 300px;
    align-items: center;
}

.tradeHistory .userStat .info {
    flex: 1;
}

.tradeHistory .userStat .icon {
    flex: 0 0 60px;
    max-width: 60px;
}

.tradeHistory .userStat .info .name {
    font-size: 20px;
    color: #3c2a01;
}

.tradeHistory .userStat .info .value {
    font-size: 30px;
}

.icon {
    width: 24px;
    height: 50px;
    margin-right: 5px;
    background-repeat: no-repeat;
    background-size: cover;
    background-position: center;
}

.borderTopColor{
    border-top: 1px solid rgba(255, 255, 255, 0.22);
}

.history .box-result-header {
    color: rgba(255, 255, 255, 0.7);
    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
    font-size: 14px;
    padding: 10px 5px;
    height: 50px;
}

.history .box-result .item {
    border-bottom: 1px solid rgba(255, 255, 255, 0.1);
    color: #fff;
    padding: 10px 5px;
    height: 50px;
}

.history .box-result .block-col.amount {
    flex: 0 0 85px;
    max-width: 85px;
}

.history .box-result .block-col.status {
    flex: 0 0 90px;
    max-width: 90px;
}

.history .box-result .block-col p > span {
    line-height: 30px;
}

.history .box-result .item svg {
    width: 14px;
    margin-right: 5px;
    vertical-align: middle;
}

.history .box-result .block-col.amount span {
    padding: 0 10px;
}

.history .box-result .item span {
    font-size: 14px;
}

.history .box-result .block-col > span {
    line-height: 30px;
}

.history .box-result .block-col.note span{
    overflow: hidden;
    white-space: nowrap;
    text-overflow: ellipsis;
    display: block;
    width: 100%;
}

.history .item-txid-desc {
    overflow: hidden;
    text-overflow: ellipsis;
    padding: 0 5px;
    white-space: nowrap;
    display: block !important;
}


.history-nav .nav-tabs {
    border-bottom: 2px solid rgba(255, 255, 255, 0.1);
    position: relative;
}

.history .box-result .block-col > span {
    line-height: 30px;
}

.history .box-result .block-col {
    flex: 1;
    white-space: nowrap;
    overflow: hidden;
    display: inline-block;
    padding-top: 0;
    padding-bottom: 0;
}

.history .box-result .block-col.time {
    flex: 0 0 110px;
    max-width: 110px;
}

.history-body{
    background: #02142b;
    border-radius: 5px;
    border: none;
    padding: 0 !important;
    border: 1px solid rgba(255, 255, 255, 0.15);
}
